import React from 'react';
import '../App.css';


function Habit(props){
  return (
    <div className="habit">
      // <div className={`circle ${props.result}`} onClick={() => {props.logHabits(props.itemPos, props.stackID)}}></div>
      <div className="circle"></div>
      <div className="habitText">
          <div className="cue">{props.cue}</div>
          <div className="action">{props.action}</div>
      </div>
  </div>
  )
}


export default Habit;
